import React, { useState } from "react";
import "./Login.css"; // Reuse neumorphic styling

const PaymentPage = () => {
  const [cardName, setCardName] = useState("");
  const [cardNumber, setCardNumber] = useState("");
  const [expiry, setExpiry] = useState("");
  const [cvv, setCvv] = useState("");
  const [message, setMessage] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!cardName || !cardNumber || !expiry || !cvv) {
      setMessage("‚ö†Ô∏è Please fill in all payment details.");
      return;
    }
    setMessage("‚úÖ Payment successful! Thank you for your purchase.");
  };

  return (
    <div className="login-container">
      <div
        className="login-card"
        style={{
          maxWidth: "900px",
          display: "flex",
          flexDirection: "row",
          alignItems: "flex-start",
          justifyContent: "space-between",
          gap: "30px",
          padding: "40px",
        }}
      >
        {/* LEFT SIDE ‚Äî PAYMENT FORM */}
        <div style={{ flex: "1.5" }}>
          <div className="login-header">
            <h2 style={{ fontSize: "1.5rem" }}>Payment Information</h2>
            <p>Please enter your card details below.</p>
          </div>

          <form onSubmit={handleSubmit}>
            <div className="form-group">
              <div className="neu-input">
                <input
                  type="text"
                  id="cardName"
                  placeholder=" "
                  value={cardName}
                  onChange={(e) => setCardName(e.target.value)}
                />
                <label htmlFor="cardName">Name on Card</label>
              </div>
            </div>

            <div className="form-group">
              <div className="neu-input">
                <input
                  type="text"
                  id="cardNumber"
                  placeholder=" "
                  maxLength="19"
                  value={cardNumber}
                  onChange={(e) => setCardNumber(e.target.value)}
                />
                <label htmlFor="cardNumber">Card Number</label>
              </div>
            </div>

            <div
              className="form-group"
              style={{ display: "flex", gap: "16px" }}
            >
              <div className="neu-input" style={{ flex: 1 }}>
                <input
                  type="text"
                  id="expiry"
                  placeholder=" "
                  maxLength="5"
                  value={expiry}
                  onChange={(e) => setExpiry(e.target.value)}
                />
                <label htmlFor="expiry">Expiration (MM/YY)</label>
              </div>

              <div className="neu-input" style={{ flex: 1 }}>
                <input
                  type="password"
                  id="cvv"
                  placeholder=" "
                  maxLength="4"
                  value={cvv}
                  onChange={(e) => setCvv(e.target.value)}
                />
                <label htmlFor="cvv">CVV</label>
              </div>
            </div>

            <button type="submit" className="neu-button">
              <span className="btn-text">Pay Now</span>
            </button>

            {message && (
              <p
                style={{
                  textAlign: "center",
                  color: "#3d4468",
                  marginTop: "12px",
                  fontWeight: "500",
                }}
              >
                {message}
              </p>
            )}
          </form>
        </div>

        {/* VERTICAL DIVIDER */}
        <div
          style={{
            width: "2px",
            background:
              "linear-gradient(180deg, transparent, #04060cff, transparent)",
            alignSelf: "stretch",
          }}
        ></div>

        {/* RIGHT SIDE ‚Äî CART SUMMARY */}
        <div style={{ flex: "1", paddingLeft: "20px" }}>
          <h3
            style={{
              color: "#3d4468",
              fontSize: "1.25rem",
              marginBottom: "16px",
            }}
          >
            Your Cart üõí
          </h3>

          <div style={{ marginBottom: "20px" }}>
            <div
              style={{
                display: "flex",
                justifyContent: "space-between",
                marginBottom: "10px",
              }}
            >
              <div>
                <p style={{ fontWeight: "600", color: "#3d4468" }}>
                  MindScape Premium
                </p>
                <p style={{ fontSize: "14px", color: "#6c7293" }}>
                  Mood Tracking Plan
                </p>
              </div>
              <p style={{ fontWeight: "600", color: "#3d4468" }}>$9.99</p>
            </div>

            <div
              style={{
                display: "flex",
                justifyContent: "space-between",
                marginBottom: "10px",
              }}
            >
              <div>
                <p style={{ fontWeight: "600", color: "#3d4468" }}>
                  Daily Journal Add-on
                </p>
                <p style={{ fontSize: "14px", color: "#6c7293" }}>
                  Enhanced features
                </p>
              </div>
              <p style={{ fontWeight: "600", color: "#3d4468" }}>$4.99</p>
            </div>

            <div
              style={{
                height: "2px",
                background:
                  "linear-gradient(90deg, transparent, #bec3cf, transparent)",
                margin: "15px 0",
              }}
            ></div>

            <div
              style={{
                display: "flex",
                justifyContent: "space-between",
                fontWeight: "700",
                fontSize: "18px",
              }}
            >
              <p>Total</p>
              <p>$14.98</p>
            </div>
          </div>

          <div
            style={{
              display: "flex",
              justifyContent: "center",
              gap: "10px",
              marginTop: "20px",
            }}
          >
          </div>
        </div>
      </div>
    </div>
  );
};

export default PaymentPage;
